func main() {
	// cmd.Execute()

	println("hello main")

	data, _ := simplejson.NewJson([]byte(infoStr))

	list, _ := data.Get("data").Get("widgets").Array()

	// éålist
	for i := 0; i < len(list); i++ {
		widget := data.Get("data").Get("widgets").GetIndex(i)

		dirName, _ := widget.Get("title").String()
		// æ¿æ¢dirNameä¸­ç /

		dirName = strings.ReplaceAll(dirName, "/", "_")
		println("dirName= " + dirName)

		resources, _ := widget.Get("resources").Array()

		for j := 0; j < len(resources); j++ {
			// for j := 0; j < 2; j++ {
			res := widget.Get("resources").GetIndex(j)

			name, _ := res.Get("name").String()
			name = strings.ReplaceAll(name, "/", "_")
			vodId, _ := res.Get("vod_id").String()

			result, _ := getInfo(vodId)

			playAuth, _ := result.Get("data").Get("PlayAuth").String()
			// println("get playAuth= " + playAuth)

			output := dirName + "/" + name
			println("output= " + output)

			videoId, _ := result.Get("data").Get("VideoMeta").Get("VideoId").String()

			downVideo(playAuth, videoId, output)

			// å¿é¡»è®¾ç½®ç§å­ï¼å¦åæ¯æ¬¡è¿è¡ç»æç¸å
			rand.New(rand.NewSource(time.Now().UnixNano()))
			// çæ 1-10 éæºæ´æ° (åå«è¾¹ç)
			randomNumber := rand.Intn(20) + 1 + 50

			println("ç­å¾ " + strconv.Itoa(randomNumber) + " ç§ããããããããã")
			for w := 1; w < randomNumber; w++ {
				tool.DrawProgressBar("wait"+strconv.Itoa(randomNumber)+"s", float32(w)/float32(randomNumber), 40)
				time.Sleep(1 * time.Second)
			}

		}

	}

}

func getInfo(videoId string) (*simplejson.Json, error) {

	timestamp := time.Now().Unix()
	urlGet := "https://api.home-plan.cn/api/file/alioss-video/" + videoId + "?t=" + strconv.FormatInt(timestamp, 10) + "&app_id=7"

	println("urlGet= " + urlGet)

	resp, err := httpclient.WithHeaders(map[string]string{
		"authorization": authorization,
	}).Get(urlGet)

	if err != nil {
		log.Println(err)
		return nil, err
	}
	data, err := resp.ReadAll()
	if err != nil {
		log.Println(resp)
		return nil, err
	}
	return simplejson.NewJson(data)
}

func downVideo(playAuth string, videoId string, output string) {
	chanSize := 1
	if playAuth == "" {
		tool.PanicParameter("playAuth")
	}
	if videoId == "" {
		tool.PanicParameter("videoId")
	}
	if output == "" {
		tool.PanicParameter("output")
	}
	if chanSize <= 0 {
		panic("parameter 'chanSize' must be greater than 0")
	}
	// éæºå­ç¬¦ä¸²
	clientRand := uuid.NewString()
	sj, err := request.GetVodPlayerInfo(clientRand, playAuth, videoId)
	if err != nil {
		log.Fatalln(err)
		return
	}
	//tool.PrintJson(sj)
	playInfoList, err := sj.Get("PlayInfoList").Get("PlayInfo").Array()
	if err != nil {
		log.Fatalln(err)
		return
	}
	playInfo := sj.Get("PlayInfoList").Get("PlayInfo").GetIndex(len(playInfoList) - 1)
	// tool.PrintJson(playInfo)
	serverRand, _ := playInfo.Get("Rand").String()
	plaintext, _ := playInfo.Get("Plaintext").String()
	playURL, _ := playInfo.Get("PlayURL").String()
	tool.PrintJson(playURL)
	key := tool.DecryptKey(clientRand, serverRand, plaintext)

	// æ·»å æä»¶åç§°
	videoTitle, _ := sj.Get("VideoBase").Get("Title").String()
	downloader, err := download.NewTask(output, playURL, key, videoTitle)
	if err != nil {
		panic(err)
	}
	if err := downloader.Start(chanSize); err != nil {
		panic(err)
	}
	fmt.Println("Done!")
}
